import React from 'react';


function Square(){
    const [value, setValue] = React.useState();

    const handleClick = () => {
        console.log("Clicked!");
    }

    return (
        <button className="square-button" onClick={handleClick}>
                {value}
        </button>
    );
}

export default Square;
